import { useState } from "react";
import { BrowserRouter as Router,Routes,Route,Link } from "react-router-dom"
import { useNavigate } from "react-router-dom";


const SignUp=()=>{
    const[name,namechange]=useState("");
    const[email,emailchange]=useState("");
    const[pswd,pswdchange]=useState("");
    const[cpswd,cpswdchange]=useState("");
    const navigate=useNavigate();

    const IsValidate=()=>{
        let isproceed=true;
        return isproceed;
    }

    const handlesubmit=(e)=>{
        if(IsValidate()){
        e.preventDefault();
        let regobj={name,email,pswd,cpswd}
        fetch("http://localhost:3006/users",{
            method:"POST",
            headers: {'Content-Type' : 'application/json'},
            body: JSON.stringify(regobj)
        }).then((res)=>{
              alert("Registered Successfully")
              navigate("/Login")
        }).catch((err)=>{
              alert("Failed:"+err.message); 
        });
    }
    }
    return(
        <div>
            <div className="offset-lg-3 col-lg-6">
                <form className="container" onSubmit={handlesubmit}>
                    <div className="card">
                        <div className="card-header">
                           <h1>Registration</h1> 
                        </div>
                        <div className="card-body">
                            <div className="column">
                                <div className="col-lg-6">
                                   <div className="form-group">
                                    <label>Full Name</label>
                                    <input value={name} required onChange={e=>namechange(e.target.value)} type="text"className="form-control"></input>
                                   </div>
                                </div>
                                <div className="col-lg-6">
                                   <div className="form-group">
                                    <label>Email</label>
                                    <input value={email} required onChange={e=>emailchange(e.target.value)}type="email"className="form-control"></input>
                                   </div>
                                </div>
                                <div className="col-lg-6">
                                   <div className="form-group">
                                    <label>Password</label>
                                    <input value={pswd} required onChange={e=>pswdchange(e.target.value)} type="password"className="form-control"></input>
                                   </div>
                                </div>
                                <div className="col-lg-6">
                                   <div className="form-group">
                                    <label>Confirm Password</label>
                                    <input value={cpswd} required onChange={e=>cpswdchange(e.target.value)}type="password"className="form-control"></input>
                                   </div>
                                </div>
                            </div>
                        </div>
                        <div className="card-footer">
                        <button type='submit' style={{marginRight:"2%",marginLeft:"2%"}}  className="btn btn-primary" >SignUp</button> 
                        <Link type='submit'  style={{marginRight:"2%",marginLeft:"2%"}} className="btn btn-danger" to="/">Back</Link> 
                        </div>
                    </div>
                </form>
            </div>
        </div>
    )
}
export default SignUp;
